  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, current, and other data were
  collected from FIXED PLATFORMS in the Gulf of Alaska from 31 March 2000 to 19 September
  2001. Data were collected by the Pacific Marine Environmental Laboratory (PMEL)
  in support of the Fisheries Oceanography Coordination Investigations (FOCI) Program.
  Physical data include temperature, salinity, pressure, and conductivity. Current
  data include current direction, current speed, zonal current velocity, and meridional
  current velocity.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
